import{_ as e,o as t,c as r,O as n}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 58.1-511 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/58.1-511.md","filePath":"vacode/58.1-511.md"}'),a={name:"vacode/58.1-511.md"},o=n('<h1 id="§-58-1-511-definitions" tabindex="-1">§ 58.1-511 Definitions. <a class="header-anchor" href="#§-58-1-511-definitions" aria-label="Permalink to &quot;§ 58.1-511 Definitions.&quot;">​</a></h1><p>For the purposes of the article:</p><p>&quot;Interest in real property&quot; means any right in real property, including access thereto or improvements thereon, or water, including but not limited to an open-space easement or conservation easement, provided such interest complies with the requirements of the U.S. Internal Revenue Code § 170 (h), partial interest, mineral right, remainder or future interest, or other interest or right in real property.</p><p>&quot;Land&quot; or &quot;lands&quot; means real property, with or without improvements thereon; rights-of-way, water and riparian rights; easements; privileges and all other rights or interests of any land or description in, relating to or connected with real property.</p><p>&quot;Public or Private Conservation Agency&quot; means any Virginia governmental body, or any private not-for-profit charitable corporation or trust authorized to do business in the Commonwealth and organized and operated for natural resources, land conservation or historic preservation purposes, and having tax-exempt status as a public charity under the U.S. Internal Revenue Code of 1986, as amended, and having the power to acquire, hold and maintain land and/or interests in land for such purposes.</p><p>1999, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0968" target="_blank" rel="noreferrer">968</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0983" target="_blank" rel="noreferrer">983</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0940" target="_blank" rel="noreferrer">940</a>.</p>',6),i=[o];function s(p,l,d,c,h,u){return t(),r("div",null,i)}const _=e(a,[["render",s]]);export{g as __pageData,_ as default};
